import { Component, OnInit } from '@angular/core';
import { CountryApiService } from './country-api.service';

@Component({
  selector: 'app-svg-map',
  templateUrl: './svg-map.component.html',
  styleUrls: ['./svg-map.component.css'],
})
export class CountryMapComponent implements OnInit {
  constructor(private countryApiService: CountryApiService) {}

  ngOnInit(): void {
    this.fetchCountries();
  }

  fetchCountries(): void {
    this.countryApiService.getCountries().subscribe(
      (response) => {
        const countries = response[1];
        console.log(countries); // Handle the retrieved data as needed
      },
      (error) => {
        console.error('Error fetching countries:', error);
      }
    );
  }
}
